import { connect } from "react-redux";
import ReceiptList from "../components/Receipts/ReceiptList";
import React from "react";
import { requestReceipts, startReceiptAdd } from "../components/Redux/Actions";

class ReceiptListContainer extends React.Component {
  componentWillMount() {
    if (!this.props.receipts || !this.props.receipts.length) {
      this.props.requestReceipts();
    }
  }

  render() {
    return <ReceiptList {...this.props} />;
  }
}

const mapStateToProps = (state) => {
  console.log(state);
  return {
    receipts: state.form.main.receipts,
  };
};

const mapDispatchToProps = (dispatch) => ({
  requestReceipts: () => dispatch(requestReceipts()),
  onAdd: () => dispatch(startReceiptAdd()),
});

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(ReceiptListContainer);
